import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

//stylesheet
import { GlobalStyle } from "./GlobalStyle";

//components
import Home from "./components/Home";

const App = () => (
  <>
    <Router>
      <Home />

      <GlobalStyle />
    </Router>
  </>
);
export default App;
